import React, { useState } from 'react';
import './Gallery.css';

function Gallery() {

    const [value,setValue] = useState("")
    
    const [results,setResults] = useState([])

    const fetchImages = () => {
        fetch('https://api.unsplash.com/photos/?client_id=iU1nsbeOMcgen6Xb1x-T4zIGER6YnvJ3zPUc5ovOXew')
        .then(res => res.json())
        .then(data => {
            console.log(data)
            setResults(data.results)
        })
    }


  return (
    <div className='gallery'>

    </div>
  );
};

export default Gallery;
